interface i1155 {
    function getContract(address caller_) external pure returns(bool);
    function getvolume(uint256 label_) external pure returns(uint256, address[] memory);
    function gflame(string memory flame_) external pure returns(address);
    function getadmin(address admin_) external pure returns(bool);
    }

contract kettle {

    using SafeMath for uint256;
    address public WBNB = 0xbb4CdB9CBd36B01bD1cBaEBF2De08d9173bc095c;
    mapping(uint256=>mapping(address=>uint256)) public label2token2royalteacollected;
    mapping(address=>uint256) public royalteaspaid;
    mapping(uint256=>uint256) public label2royalteaspaid;
    mapping(uint256=>mapping(address=>uint256)) public label2token2royalteaspaid;
    mapping(address=>mapping(uint256=>mapping(address=>uint256))) public buyer2label2token2royaltystart;
    mapping(uint256=>mapping(address=>uint256)) public label2token2buyers;

    mapping(address=>mapping(uint256=>uint256)) public buyerToCollectionToRoyalty;

    event paid(
        address spender,
        address token,
        uint256 value,
        uint256 type_,
        uint256 label_
    );
    event royalteaclaimed(
        address holder,
        uint256 amount,
        uint256 label
    );
    string public name = "KETTLE V1";
    address public _fire;
    constructor(address fire_){
        _fire = fire_;
    }

    receive () external payable {}
    function setfire(address fire_) external returns(bool){

        (bool success) = i1155(_fire).getContract(msg.sender);
        require(success, 'not valid caller');
        _fire = fire_;
        return true;
    }
    function pay(address token_, address payee_, uint256 value_,uint256 type_,uint256 label_) external returns(bool){

        (bool success) = i1155(_fire).getContract(msg.sender);
        require(success, 'not valid caller');
        uint256 pot_ = IERC20(token_).balanceOf(address(this)).mul(10).div(100);
        require(value_ <= pot_, 'low balance');
        (success) = IERC20(token_).transfer(payee_, value_);
        require(success, 'error paying');
        if(type_==1){
            royalteaspaid[token_] += value_;
            label2royalteaspaid[label_] += value_;
            label2token2royalteaspaid[label_][token_] += value_;
        }
        emit paid(payee_, token_, value_, type_, label_);
        return success;
    }

    function setroyaltea(uint256 label_, address token_, uint256 amount_, address buyer_) external returns(bool){
        (bool success) = i1155(_fire).getContract(msg.sender);
        require(success, 'not valid caller');

        label2token2royalteacollected[label_][token_] += amount_;
        if(buyer2label2token2royaltystart[buyer_][label_][token_]==0){
            buyer2label2token2royaltystart[buyer_][label_][token_] = label2token2royalteacollected[label_][token_];
        }
        return true;
    }
    function getbuyerroyaltes(uint256 label_, address token_, address buyer_) public view returns(uint256){

        uint256 royalteas = label2token2royalteacollected[label_][token_];
        uint256 royalteastart = buyer2label2token2royaltystart[buyer_][label_][token_];
        (address flame_) = i1155(_fire).gflame('shopstorage');
        (,address[] memory buyers_) = i1155(flame_).getvolume(label_);

        if(royalteastart>0){
            royalteas = royalteas.sub(royalteastart).div(buyers_.length);
        }else{
            royalteas = 0;
        }
        return royalteas;
    }
    function getroyatea(uint256 label_, address token_, address buyer_) public view returns(uint256[] memory, address[] memory){

        uint256 walletbalance = IERC20(token_).balanceOf(address(this));
        uint256 br = getbuyerroyaltes(label_,token_,buyer_);
        (address flame_) = i1155(_fire).gflame('shopstorage');
        (uint256 volume_,address[] memory buyers_) = i1155(flame_).getvolume(label_);

        uint256[] memory numbers_ = new uint256[](7);
        numbers_[0] = label2token2royalteacollected[label_][token_].sub(label2token2royalteaspaid[label_][token_]);
        numbers_[1] = label2token2royalteaspaid[label_][token_];
        numbers_[2] = label2token2royalteacollected[label_][token_];
        numbers_[3] = br;
        numbers_[4] = buyers_.length;
        numbers_[5] = volume_;
        numbers_[6] = walletbalance;
        return(numbers_, buyers_);
    }
    function claimroyaltea(uint256 label_, address token_) public {

        uint256 royalteas = getbuyerroyaltes(label_,token_,msg.sender);
        if(royalteas>0){
            IERC20(token_).transfer(msg.sender,royalteas);
            require(checkSuccess(), 'error paying royateas');
            buyer2label2token2royaltystart[msg.sender][label_][token_] = label2token2royalteacollected[label_][token_];
            label2token2royalteaspaid[label_][token_] += royalteas;
            emit royalteaclaimed(msg.sender,royalteas,label_);
        }
    }
    function WITHDRAWBNB(address payable payto_,  uint256 value_) public returns(bool){

        (bool success) = i1155(_fire).getadmin(msg.sender);
        require(success, 'not an admin kettle 1');
        (success,) = payto_.call{value: value_}("");
        require(success, 'error withdrawing bnb');
        return success;

    }
    function WITHDRAWTOKEN(address payto_, address token_, uint256 value_) public returns(bool){

        (bool success) = i1155(_fire).getadmin(msg.sender);
        require(success, 'not an admin kettle 2');
        require(IERC20(token_).balanceOf(address(this))>= value_ , 'balance not equal to value');
        (success) = IERC20(token_).transfer(payto_,value_);
        require(success, 'error paying token to vault holder');
        return success;
    }

    function checkSuccess()
    private pure
    returns (bool)
    {
        uint256 returnValue = 0;

        /* solium-disable-next-line security/no-inline-assembly */
        assembly {
        // check number of bytes returned from last function call
            switch returndatasize()

            // no bytes returned: assume success
            case 0x0 {
                returnValue := 1
            }

            // 32 bytes returned: check if non-zero
            case 0x20 {
            // copy 32 bytes into scratch space
                returndatacopy(0x0, 0x0, 0x20)

            // load those bytes into returnValue
                returnValue := mload(0x0)
            }

            // not sure what was returned: dont mark as success
            default { }

        }

        return returnValue != 0;
    }
}
